CharacterSkin.prototype.loadPlayerMaster = function(currentSkin,currentBow){

	console.log("loadPlayerMaster " +currentSkin);
	//Load Skin 
	var currentSkinCharacter = currentSkin;
	player_idle = this.idleAnimationsMaster[currentSkinCharacter];
	player_shoot = this.shootAnmationsMaster[currentSkinCharacter];
	player_shoot.visible = false;

	player_left_shoot = this.leftShootMaster[currentSkinCharacter];
	player_right_shoot= this.rightShootMaster[currentSkinCharacter];
	player_hand_fingers = this.hand2FingersMaster[currentSkinCharacter];
	player_shoot.position.setTo(player_idle.x,player_idle.y);


	//Load Bow

	switch(currentSkin){
		case 0:
		//Astoria
		this.visibleBowMaster(false);
		this.fAstoria_animation_idle.showCurretBow(localData.currentBow);
		this.astoriaBowsShootMaster[currentBow].visible = true;
		player_bow =this.astoriaBowsShootMaster[currentBow];
		this.astoriaLineBowMaster[currentBow].visible  = true;
		player_line_bow =this.astoriaLineBowMaster[currentBow];
		break;

		case 1:
		//Oliver
		this.visibleBowMaster(false);
		this.oliverBowsIdleMaster[currentBow].visible = true;
		this.oliverBowsShootMaster[currentBow].visible = true;
		player_bow =this.oliverBowsShootMaster[currentBow];
		this.oliverLineBowMaster[currentBow].visible  = true;
		player_line_bow =this.oliverLineBowMaster[currentBow];
		break;

		case 2:
		//Rigg
		this.visibleBowMaster(false);
		this.riggBowsIdleMaster[currentBow].visible = true;
		this.riggBowsShootMaster[currentBow].visible = true;
		player_bow =this.riggBowsShootMaster[currentBow];
		this.riggLineBowMaster[currentBow].visible  = true;
		player_line_bow =this.riggLineBowMaster[currentBow];
		break;

		case 3:
		//Graham
		this.visibleBowMaster(false);
		this.grahamBowsIdleMaster[currentBow].visible = true;
		this.grahamBowsShootMaster[currentBow].visible = true;
		player_bow =this.grahamBowsShootMaster[currentBow];
		this.grahamLineBowMaster[currentBow].visible  = true;
		player_line_bow =this.grahamLineBowMaster[currentBow];
		break;
	}

	
	this.currentSettingMaster = this.settingCharacterMaster[currentSkinCharacter];

	
}


