CharacterSkin.prototype.createArrow = function(){
	//Setting arrow Player
	arrowPlayerPool = this.game.add.group();
	arrowPlayerVisible = new Array();
	arrowPlayerElapsedTime = new Array();
	arrowsPlayerBody.push(null);
	arrowsPlayerBody.push(null);
	player_arrow_collisions = new Array();
  if(arrowPlayerVisible.length >0) return;
	for (var i = 0; i < NUMBER_OF_ARROWS; i++) {
        var arrow = this.game.add.sprite(999.0, 999.0, 'characterAtlas', 'player_idle', this);
        arrow.scale.setTo(arrowObject.scale.x, arrowObject.scale.y);
        arrow.animations.add('hit', ['Arrow_02'], 60, false);
        arrow.animations.add('full', ['Arrow_01'], 60, false);
        arrowPlayerPool.add(arrow);
        arrowPlayerVisible.push(false);
        arrowPlayerElapsedTime.push(0);
        player_arrow_collisions.push(COLLISION.NONE);
        // Hide Arrow
        arrowPlayerPool.getAt(i).visible = false;
        // Enable physics on the Arrows
        game.physics.enable(arrow, Phaser.Physics.ARCADE);
        // DisEnable gravity
        arrow.body.allowGravity = false;


        // Set its initial state to "dead".
        arrow.kill();
    }
}